INSERT INTO "components_home_identities" ("id", "eyebrow", "title", "subtitle", "description", "data_uid") VALUES (2, 'Nuestra identidad', 'Formamos y acompaamos comunidades en el Valle del Cauca', 'Presentamos la esencia de FACOPEC con una estructura clara para gestionar la informacin desde Strapi y comunicar nuestro propsito de forma cercana.', 'Somos FACOPEC, una fundacin afrocolombiana que canaliza recursos locales, nacionales e internacionales para impulsar proyectos educativos, culturales, recreativos y tecnolgicos en comunidades negras, afrocolombianas, raizales y palenqueras.', 'about.description');
